import '../App.css';

const Todo = () => {

   var rtIfRT = function () {
      function onClick1() {
          this.toggle();
      }
      return React.createElement('div', {}, React.createElement('h4', {
          'style': { cursor: 'pointer' },
          'onClick': onClick1.bind(this)
      }, '\n        Click to ', this.state.open ? 'close' : 'open', '\n    '), this.state.open ? React.createElement('p', { 'key': '134' }, 'This is my paragraph. It opens and\n                               closes') : null);
  };

   return ( 
   <div>
      <h4 rtIfRT>
          Click to {this.state.open ? 'close' : 'open'}
      </h4>
      <p rt-if="this.state.open">This is my paragraph. It opens and
                                 closes</p>
  </div>
  )
}

export default Todo
